        [logo]

        To all whom it may concern: This room is filled with nitrogen, as such if you have no need for a room such as this please use another.


        Additionally: Due to the nature of pure nitrogen's effect on our critter filter system, the air vents do NOT have the ability to prevent vent critters from escaping to this room.


        Due to this, we have provided an escape hatch. If you hear any rattling and suspect critters may escape the vents, do not hestitate to make use of it.

        On the other side, you will find masks, nitrogen tanks, and clothing enough for 5 crewmembers. After which there will be a seperate exit to leave to the main parts of the station.

        Once the threat has been dealt with, you may then come back to retrieve your stuff.


        Edit: We *think* we fixed the issue, but just in case, the escape route is still there.
